import Head from 'next/head';
import Navbar from './Navbar'

function Layout() {
  return (
    <div>
      <Head>
        <title>Header Website</title>
        <link rel="stylesheet" href="../../public/css/global.css"/>
      </Head>
      <Navbar/>
    </div>
  )
}

export default Layout
